import { Link, NavLink } from 'react-router-dom';
import Sign from './Sign';
function Register() {
    return (
        <>
        <Sign
        title='Регистрация'
        textButton='Зарегистрироваться'
        >
            <input className="popup__input popup__input_type_email" id="email-input" type="email" name="email" placeholder="E-mail"/>
            <span className="email-input-error"/>
            <input className="popup__input popup__input_type_password" id="password-input" type="password" name="password" placeholder="Пароль"/>
            <span className="password-input-error"/>
        </Sign>
        <p className="registaration__text">Уже зарегестрированы?</p>
        <Link to="/sign-in" className="registation__link">Войти</Link>
        </>
    )
}
export default Register
